### Fina all approximate occurrences of a pattern in a string ###
from BA1G import HammingDistance

def ApproxPattern(pattern,string,d):
    l,m = len(pattern),len(string)
    occurList = []
    for i in range(m-l+1):
        substring = string[i:i+l]
        if HammingDistance(pattern,substring) <= d:
            occurList.append(i)
    return occurList

p = 'AGATTTGTAAA'
q = ''
d = 4
#print(ApproxPattern(p,q,d))

answer = ''
for ans in ApproxPattern(p,q,d):
    answer += str(ans) + ' '
answer = answer[:-1]
print(answer)